import React, { Component } from 'react'
import '../App.css'

class Logo extends React.Component {
  showSettings (event) {
    event.preventDefault();
  }

  render () {
    return (
      <div>
        <img src={logo} className="App-logo synapse-logo" alt="logo" />
        <img src={text} className="Text-logo synapse-logo" alt="logo" />
      </div>


    );
  }
}

export default Logo
